import React, { useEffect, useState} from 'react';
import axios from 'axios';
import { useForm, useFieldArray } from "react-hook-form";
// import { useTheme } from "@emotion/react";
import { useTheme } from "@mui/material/styles"
import { Box, TextField, Typography, Button, IconButton, Grid } from "@mui/material";
import SaveIcon from '@mui/icons-material/Save';
import AddCircleOutlineIcon from '@mui/icons-material/AddCircleOutline';
import ExitToAppIcon from '@mui/icons-material/ExitToApp';
import DeleteIcon from '@mui/icons-material/Delete';
import { useNavigate } from 'react-router-dom';




function Dashboard() {

   // new line start

const [profileData, setProfileData] = useState(null);

  function getData() {
    axios({
      method: "GET",
      // url:"/profile",
      url:"http://localhost:5000/profile",
    })
    .then((response) => {
      const res =response.data
      setProfileData(({
        profile_name: res.name,
        about_me: res.age,
        nhs_number: res.nhsNumber,
        problem_description: res.problemDescription,
        desired_values: res.desiredValues,

        }))
    }).catch((error) => {
      if (error.response) {
        console.log(error.response)
        console.log(error.response.status)
        console.log(error.response.headers)
        }
    })}
    //end of new line 

   return (
    <div className="App">
      <header className="App-header">



        {/* new line start*/}
        <p>To get your profile details: </p><button onClick={getData}>Click me</button>
        {profileData && <div>
              <p>Profile name: {profileData.profile_name}</p>
              <p>About me: {profileData.about_me}</p>
              <p>NHS number: {profileData.nhs_number}</p>
              <p>Problem description: {profileData.problem_description}</p>
              {/* <p>Desired values: {profileData.desired_values}</p> */}
            </div>
        }
         {/* end of new line */}
      </header>
    </div>
  );

}

export default Dashboard;
